import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SpecsComponent = () => {
    const [specs, setSpecs] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchSpecs = async () => {
            try {
                const response = await axios.get('/api/v1/specs');
                setSpecs(response.data.data);
                setLoading(false);
            } catch (err) {
                setError('Error fetching specs');
                setLoading(false);
            }
        };

        fetchSpecs();
    }, []);

    if (loading) {
        return <div>Loading...</div>;
    }

    if (error) {
        return <div>{error}</div>;
    }

    return (
        <div style={{color:"white"}}>
            <h1>Specs</h1>
            <ul>
                {specs.map((spec) => (
                    <li key={spec._id}>
                        <strong>Horsepower:</strong> {spec.horsepower}<br />
                        <strong>Engine:</strong> {spec.engine}<br />
                        <strong>Energy:</strong> {spec.energy}<br />
                        <strong>Displacement:</strong> {spec.displacement}<br />
                        <strong>Power:</strong> {spec.power}<br />
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default SpecsComponent;
